e_field_issue_solution_attempts([Elem | Rest], Bin, TrUserData) ->
    Bin2 = <<Bin/binary, 18>>,
    Bin3 = e_mfield_issue_solution_attempts(id(Elem, TrUserData), Bin2, TrUserData),
    e_field_issue_solution_attempts(Rest, Bin3, TrUserData);
e_field_issue_solution_attempts([], Bin, _TrUserData) -> Bin.

