decode_msg_issue(Bin, TrUserData) -> dfp_read_field_def_issue(Bin, 0, 0, 0, id(0, TrUserData), id([], TrUserData), id(false, TrUserData), id(0, TrUserData), id(0, TrUserData), id(0, TrUserData), id(<<>>, TrUserData), TrUserData).

