dfp_read_field_def_issue(<<>>, 0, 0, _, F@_1, R1, F@_3, F@_4, F@_5, F@_6, F@_7, TrUserData) ->
    S1 = #{id => F@_1, open => F@_3, year => F@_4, day => F@_5, part => F@_6, last_error_code => F@_7},
