verify_msg(Msg, MsgName) when is_atom(MsgName) -> verify_msg(Msg, MsgName, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        issue -> v_msg_issue(Msg, [MsgName], TrUserData);
        solutions -> v_msg_solutions(Msg, [MsgName], TrUserData);
        solution -> v_msg_solution(Msg, [MsgName], TrUserData);
        solve_request -> v_msg_solve_request(Msg, [MsgName], TrUserData);
        solve_response -> v_msg_solve_response(Msg, [MsgName], TrUserData);
        upload_request -> v_msg_upload_request(Msg, [MsgName], TrUserData);
        upload_response -> v_msg_upload_response(Msg, [MsgName], TrUserData);
        get_data_request -> v_msg_get_data_request(Msg, [MsgName], TrUserData);
        get_data_response -> v_msg_get_data_response(Msg, [MsgName], TrUserData);
        register_request -> v_msg_register_request(Msg, [MsgName], TrUserData);
        register_response -> v_msg_register_response(Msg, [MsgName], TrUserData);
        add_solution_request -> v_msg_add_solution_request(Msg, [MsgName], TrUserData);
        add_solution_response -> v_msg_add_solution_response(Msg, [MsgName], TrUserData);
        get_solution_request -> v_msg_get_solution_request(Msg, [MsgName], TrUserData);
        get_solution_response -> v_msg_get_solution_response(Msg, [MsgName], TrUserData);
        set_cookie_request -> v_msg_set_cookie_request(Msg, [MsgName], TrUserData);
        set_cookie_response -> v_msg_set_cookie_response(Msg, [MsgName], TrUserData);
        get_solvers_request -> v_msg_get_solvers_request(Msg, [MsgName], TrUserData);
        get_solvers_response -> v_msg_get_solvers_response(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_issue/3}).
-dialyzer({nowarn_function,v_msg_issue/3}).
v_msg_issue(#{} = M, Path, TrUserData) ->
    case M of
        #{id := F1} -> v_type_int64(F1, [id | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{solution_attempts := F2} ->
            if is_list(F2) ->
                   _ = [v_submsg_solution(Elem, [solution_attempts | Path], TrUserData) || Elem <- F2],
                   ok;
               true -> mk_type_error({invalid_list_of, {msg, solution}}, F2, [solution_attempts | Path])
            end;
        _ -> ok
    end,
    case M of
        #{open := F3} -> v_type_bool(F3, [open | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{year := F4} -> v_type_int32(F4, [year | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{day := F5} -> v_type_int32(F5, [day | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{part := F6} -> v_type_int32(F6, [part | Path], TrUserData);
        _ -> ok
    end,
    case M of
        #{last_error_code := F7} -> v_type_string(F7, [last_error_code | Path], TrUserData);
        _ -> ok
    end,
    lists:foreach(fun (id) -> ok;
                      (solution_attempts) -> ok;
                      (open) -> ok;
                      (year) -> ok;
                      (day) -> ok;
                      (part) -> ok;
                      (last_error_code) -> ok;
                      (OtherKey) -> mk_type_error({extraneous_key, OtherKey}, M, Path)
                  end,
                  maps:keys(M)),
    ok;
v_msg_issue(M, Path, _TrUserData) when is_map(M) -> mk_type_error({missing_fields, [] -- maps:keys(M), issue}, M, Path);
v_msg_issue(X, Path, _TrUserData) -> mk_type_error({expected_msg, issue}, X, Path).

